import React from "react";
import "./style.css";
import users from "../../data";

users = [
    { id: 1, name: "Rashford Marcus", age: 25, from: "England", job: "Web developer", gender: "male"},
    { id: 2, name: "Jorj", age: 25, from: "German", job: "Full stack", gender: "male"},
    { id: 3, name: "Joe Bayden", age: 25, from: "French", job: "Web design", gender: "Female"},
    { id: 4, name: "Franklik", age: 25, from: "Protland", job: "Frontend", gender: "male"},
    { id: 5, name: "Bill Smit", age: 25, from: "Island", job: "Backend", gender: "male"},
]
function Card() {
  return (
    <div className="card">
      <div className="container">
        <div className="main-card">
          <div className="card-img">
            <img
              src="https://static.vecteezy.com/system/resources/previews/000/439/863/original/vector-users-icon.jpg"
              alt="user"
            />
          </div>
          <div className="card-body">
            {users.map((value) => {
              return (
                <div className="card-title">
                  <span>Rashford Marcus, </span>
                  <span>25 age</span>
                  <div>From: England</div>
                  <div>Job: Web developer</div>
                  <div>Gender: male</div>
                  <button>Delete</button>
                </div>
              );
            })}
          </div>
        </div>
      </div>
    </div>
  );
}

export default Card;
